import React from "react";
import RollingCarousel from "./Carousel/RollingCarousel";
import CategoryContainer from "./categories/CategoryContainer";
import "./Home.css";

function Home() {
  return (
    <div>
      <div className="container-fluid">
        <CategoryContainer />
        <RollingCarousel />
      </div>
    </div>
  );
}

export default Home;
